import React, { Component } from 'react'

export default class ToDoForm extends Component {
  constructor(props){
    super(props)
    this.state = {
      description: "",
      priority: ""
    }
  }
  render(){
    <form>
      <input placeholder="description">{this.state.description}</input>
      <input placeholder="priority">{this.state.priority}</input>
      <button type="submit">Add ToDo</button>
    </form>
  }
}
